import React from 'react';
import styled from 'styled-components';

const HeaderBlock = styled.div`
    position: fixed;
    width: 100%;
    background: white;
    box-shadow: 0px 2px 4px rgba( 0, 0, 0, 0.08 );

    padding: 1em;
    font-size: large;
`;

const Wrapper = styled.div`
    padding: 1.2em;
    font-size: large;
    align-items: center;
    justify-content: space-between;
`

const Header = () => {
    return (
        <>
            <HeaderBlock>
                <Wrapper>

                </Wrapper>
            </HeaderBlock>
        </>
    )
}

export default Header
